The on submit function should send the form data to the graphql api endpoint and return the response from the api.

Solution:Here is a possible implementation of the `onSubmit` function in React:
```javascript
import { gql } from '@apollo/client';

const CREATE_USER = gql`
  mutation CreateUser($input: CreateUserInput!) {
    createUser(input: $input) {
      id
      name
      email
    }
  }
`;

function onSubmit(event) {
  event.preventDefault();

  const formData = new FormData(event.target);
  const input = {
    name: formData.get('name'),
    email: formData.get('email'),
    password: formData.get('password'),
  };

  // Send the form data to the GraphQL API endpoint
  fetch('https://api.example.com/graphql', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
      query: CREATE_USER,
      variables: { input },
    }),
  })
    .then((response) => response.json())
    .then((data) => console.log(data));
}
```
In this implementation, we use the `FormData` object to extract the form data from the event target. We then construct a GraphQL query using the `gql` template literal and pass it along with the form data as variables to the `fetch` function. Finally, we log the response from the API to the console.

