## Answer

cloneElement is used to pass props to a component that you don't own. For example, if you're writing a TabBar component that displays a bunch of tabs, you might write it like this:
```
class TabBar extends React.Component {
  render() {
    return (
      <div>
        {this.props.children.map((child, idx) => {
          return React.cloneElement(child, {
            isActive: this.props.activeTabIndex === idx
          });
        })}
      </div>
    );
  }
}
```
In this example, you're not in control of the child components, so you can't pass the isActive prop to them when they're instantiated; cloneElement allows you to pass the prop in later on.

